Most terminal applications — including Windows CMD, PowerShell, Git Bash, Windows Terminal, and VSCode — support `Ctrl + Mouse Wheel` as a way to zoom text in and out.

Tabby currently does not support this functionality, which is unexpected for users coming from other terminals.

Even a basic `wheel` event listener with a `ctrlKey` check would be enough for a great UX improvement:

```js
window.addEventListener('wheel', (event) => {
  if (event.ctrlKey) {
    if (event.deltaY < 0) {
      // Zoom in
    } else {
      // Zoom out
    }
  }
});

This feature would bring Tabby in line with modern usability expectations and improve user experience, especially for Windows users.

Thanks for your awesome work on Tabby!

